from mpmath import iv
def a_upto(limit):
    sum_, highs = iv.mpf('0'), [0]
    for i in range(1, 1+limit):
        t = 2*i + 1
        sum_ += iv.sin(t)**t
        if sum_ > 0:
            highs.append(i)
            sum_ = 0
    return highs
